TERMS-OF-USE.About-general-restriction-of-use:
Wiin's shu bilan sizga quyidagi shartlarga rioya qilgan holda, Xizmatdan foydalanish va undan foydalanishga ruxsat beradi. Siz ularning hech birini bajarmasligingiz ushbu Shartlarning buzilishini bildiradi.

10.1 Siz, agar Wiin Xizmatning bir qismi sifatida taklif qilinadigan funksiya orqali bunday tarqatish vositasini taqdim qilmasa, Veb -sayt yoki Xizmatning hammasini yoki bir qismini, shu jumladan Kontentni hech qanday muhitda tarqatmaslikka rozilik bildirasiz;

10.2 Siz veb -sayt yoki xizmatning biron bir qismini o'zgartirmaslikka yoki o'zgartirmaslikka rozilik bildirasiz;

10.3 Siz Kontentga Veb -saytning o'zi, Wiin pleerining videoni ijro etish sahifalari yoki Wiin -ning aniq maqsadlari uchun ishlatadigan boshqa vositalar orqali kirmaslikka rozilik bildirasiz;

10.4 Siz Xizmatning xavfsizlikka taalluqli har qanday funktsiyasini chetlab o'tmaslikka, o'chirmaslikka yoki boshqacha tarzda aralashmaslikka, Kontentdan foydalanish yoki undan nusxa ko'chirishni oldini olishga yoki cheklashga, Xizmatdan foydalanishga cheklovlar qo'ymaslikka rozilik bildirasiz. Xizmatda mavjud bo'lgan tarkib;

10.5 Agar siz veb -saytingizda Wiin's Player -dan foydalansangiz, siz Wiin Player -ning biron -bir funktsiyasini, shu jumladan, veb -saytga havolalarni hech qanday cheklovlarsiz o'zgartirishingiz, derivativ asar yaratishingiz yoki bloklay olmaysiz;

10.6 Siz xizmatga kirish imkoniga ega bo'lgan har qanday avtomatlashtirilgan tizimni (shu jumladan, cheklovsiz, har qanday robot, o'rgimchak yoki oflayn pleyer) ishlatmaslikka yoki ishga tushirmaslikka rozilik bildirasiz, chunki u ma'lum vaqt ichida Wiin serverlariga ko'proq so'rov xabarlarini yuboradi. Odam xuddi shu vaqt oralig'ida tijoratda mavjud bo'lgan standart (ya'ni o'zgartirilmagan) Internet -brauzer yordamida ishlab chiqarishi mumkin edi;

10.7 Siz har qanday veb -sayt yoki xizmatdan foydalanuvchi haqidagi shaxsiy ma'lumotlarni to'plamaslikka yoki yig'ib olmaslikka rozilik bildirasiz (va siz bunga Wiinning hisob nomlari kiritilganligini tan olasiz);

10.8 Siz har qanday tijorat faoliyati yoki tijorat korxonasi bilan bog'liq holda, veb -sayt va Xizmatdan (shu jumladan, veb -saytdagi sharhlar va elektron pochta imkoniyatlaridan) foydalanmaslikka rozilik bildirasiz;

10.9 Siz veb -sayt foydalanuvchilaridan ularning mazmuni bo'yicha tijorat maqsadlarida talab qilmaslikka rozilik bildirasiz;

10.10 Siz Kontentga Xizmatning odatdagi funktsional imkoniyatlari nazarda tutilgan va ruxsat etilgan shaxsiy maqsadlarda foydalanishdan boshqa maqsadlarda va faqat Internet orqali bir vaqtning o'zida raqamli ma'lumotlarni uzatish maqsadida kirmaslikka rozilik bildirasiz;

10.11 Siz Wiin yoki Kontentning tegishli litsenziatlarining yozma roziligisiz hech qanday tarkibni boshqa maqsadda nusxa ko'chirolmaysiz, takrorlamaysiz, tarqatmaysiz, uzatmaysiz, namoyish qilmaysiz, sotmaysiz, litsenziyalashtirmaysiz yoki boshqa yo'l bilan ishlatmaysiz.
